import React from 'react';
import '../styles/Contact.css';

const Contact = () => {
  return (
    <div className="contact-section">
      <h2>İletişim</h2>
      <p>Bizimle iletişime geçmek için: destek@crmsupport.com</p>
      <p>Adres: Teknopark İstanbul, Bina 2, No: 301</p>
    </div>
  );
};

export default Contact;
